Let $a$, $90^{\circ}$, $90^{\circ}$, and $2a$ be the measures of the four angles of the quadrilateral, where $a$ is in degrees. We have the equation $a + 90 + 90 + 2a = 360 \implies 3a = 180 \implies a = \boxed{60^{\circ}}$. Therefore, $2a = \boxed{120^{\circ}}$. [asy]
defaultpen(linewidth(0.8));
