draw(A--B--C--D--A);
label("$90^\circ$",B+(0.3,0.3));
draw(rightanglemark(A,B,C,3.5));
label("$90^\circ$",C+(-0.3,-0.3));
draw(rightanglemark(B,C,D,3.5));
label("$60^\circ$",A+(0,0.3));
